import './Components/NavBarSyle';
function NavBar() {

    return (
        <nav className="nav">
            <Link to="/" className="Site-title">
                Clean Energy For Business
            </Link>

            <ul>
                <li><a herf='index.html'> Home</a></li>
                <li><a herf='index.html'> Shop</a></li>
                <li><a herf='index.html'> Profile</a></li>

            </ul>
        </nav>
    )
}





export default NavBar;
